import React from 'react'

const Footer = () => {
  return (
    <section className='bg-dark-hard'>
      <footer className='container mx-auto grid grid-cols-10'>
        <div className='col-span-5'>
          <h3 className='text-dark-light'></h3>
        </div>
      </footer>
    </section>
  )
}

export default Footer
